Tweet text:
@ykdojo Beyond the benefit of exposure, developing a consistent Twitter habit is creates a really positive flywheel.

Myself as an example:

In order to tweet consistently, I need to be consistently engaged in learning and building in data science and web dev.

@ykdojo Last year, I thought I needed to spend every waking minute learning to code.

This year, I get up and relax or pursue another hobby the minute I lose focus.

Maybe both phases were necessary, but I'm much happier and have more consistent progress now.
